import { useEffect, useState } from "react";
import {
  Image,
  Modal,
  ScrollView,
  StyleSheet,
  Text,
  TextInput,
  TouchableOpacity,
  View,
  Linking,
  StatusBar,
} from "react-native";
import IceCreamCard from "../../components/home/IceCreamCard";
import TopBar from "../../components/home/TopBar";
import AsyncStorage from "@react-native-async-storage/async-storage";

const HomeScreen = () => {
  const [iceCreams, setIceCreams] = useState([
    {
      name: "Fress",
      buyPrice: 0.2,
      sellPrice: 0.3,
      sellAmount: 0,
      img: "data:image/jpeg;base64,",
    },
    {
      name: "Tentacion",
      buyPrice: 0.33,
      sellPrice: 0.5,
      sellAmount: 0,
      img: "data:image/jpeg;base64,",
    },
    {
      name: "Tinitas",
      buyPrice: 0.4,
      sellPrice: 0.6,
      sellAmount: 0,
      img: "data:image/jpeg;base64,",
    },
    {
      name: "Cono chicle",
      buyPrice: 0.4,
      sellPrice: 0.6,
      sellAmount: 0,
      img: "data:image/jpeg;base64,",
    },
    {
      name: "Casero",
      buyPrice: 0.33,
      sellPrice: 0.5,
      sellAmount: 0,
      img: "data:image/jpeg;base64,",
    },
    {
      name: "Wonder",
      buyPrice: 0.47,
      sellPrice: 0.7,
      sellAmount: 0,
      img: "data:image/jpeg;base64,",
    },
    {
      name: "Choco mani",
      buyPrice: 0.47,
      sellPrice: 0.7,
      sellAmount: 0,
      img: "data:image/jpeg;base64,",
    },
    {
      name: "Choco mantecado",
      buyPrice: 0.47,
      sellPrice: 0.7,
      sellAmount: 0,
      img: "data:image/jpeg;base64,",
    },
    {
      name: "Mausi",
      buyPrice: 0.53,
      sellPrice: 0.8,
      sellAmount: 0,
      img: "data:image/jpeg;base64,",
    },
    {
      name: "Super conos",
      buyPrice: 0.67,
      sellPrice: 1,
      sellAmount: 0,
      img: "data:image/jpeg;base64,",
    },
    {
      name: "Polet",
      buyPrice: 0.8,
      sellPrice: 1.2,
      sellAmount: 0,
      img: "data:image/jpeg;base64,",
    },
  ]);
  const [dolarPrice, setDolarPrice] = useState(0);
  const [dolarAmount, setDolarAmount] = useState(0);
  const [bsAmount, setBsAmount] = useState(0);
  const [isModal, setIsModal] = useState(false);
  const [inputValue, setInputValue] = useState("");

  const storeData = async () => {
    try {
      await AsyncStorage.setItem("@dolarPrice", inputValue.toString());
    } catch (e) {
      console.log(e);
    }
  };

  const getData = async () => {
    try {
      const value = await AsyncStorage.getItem("@dolarPrice");
      if (value !== null) {
        setDolarPrice(value);
      }
    } catch (e) {
      console.log(e);
    }
  };

  useEffect(() => {
    getData();
  }, []);

  const handleAdd = (name) => {
    setIceCreams(
      iceCreams.map((item) => {
        if (item.name === name) {
          let value = item.sellAmount;
          return { ...item, sellAmount: (value += 1) };
        } else return { ...item };
      })
    );
  };

  const handleRemove = (name) => {
    setIceCreams(
      iceCreams.map((item) => {
        if (item.name === name && item.sellAmount > 0) {
          let value = item.sellAmount;
          return { ...item, sellAmount: (value -= 1) };
        } else return { ...item };
      })
    );
  };

  const handleClear = () => {
    setIceCreams(
      iceCreams.map((item) => {
        return { ...item, sellAmount: 0 };
      })
    );
  };

  useEffect(() => {
    const total = iceCreams.reduce((acc, item) => {
      return acc + item.sellAmount * item.sellPrice;
    }, 0);
    const bsToDolar = total * dolarPrice;
    setBsAmount(Math.round(bsToDolar * 100) / 100);
    setDolarAmount(Math.round(total * 10) / 10);
  }, [iceCreams]);

  const handleModal = () => {
    setIsModal(!isModal);
  };

  return (
    <>
      <StatusBar backgroundColor="white" barStyle="dark-content" />
      <Modal visible={isModal} animationType="slide">
        <View style={styles.modalView}>
          <Text>Valor actual del Bolivar: {dolarPrice} Bsf</Text>
          <TouchableOpacity
            onPress={() => Linking.openURL("http://www.bcv.org.ve/")}
          >
            <Text style={[styles.buttons, styles.bigOne]}>
              Revisar Banco Central de Venezuela
            </Text>
          </TouchableOpacity>
          <Text>Nuevo valor:</Text>
          <TextInput
            style={styles.input}
            onChangeText={(value) => setInputValue(value)}
            keyboardType={"numeric"}
          />
          <TouchableOpacity
            style={styles.buttons}
            onPress={() => {
              handleModal();
              storeData();
              getData();
            }}
          >
            <Text>Volver atras</Text>
          </TouchableOpacity>
        </View>
      </Modal>
      <ScrollView>
        <TopBar
          bsAmount={bsAmount}
          handleClear={handleClear}
          dolarAmount={dolarAmount}
          dolarPrice={dolarPrice}
          handleModal={handleModal}
        />
        {iceCreams.map((item, index) => {
          return (
            <View key={index} style={styles.container}>
              <IceCreamCard
                name={item.name}
                img={item.img}
                sellAmount={item.sellAmount}
                handleAdd={handleAdd}
                handleRemove={handleRemove}
              />
            </View>
          );
        })}
      </ScrollView>
    </>
  );
};

const styles = StyleSheet.create({
  modalView: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    height: "100%",
  },
  buttons: {
    borderWidth: 1,
    width: 120,
    display: "flex",
    flexDirection: "row",
    justifyContent: "center",
    borderRadius: 5,
  },
  input: {
    borderWidth: 1,
    width: 150,
    marginVertical: 15,
    padding: 5,
    borderRadius: 10,
    paddingHorizontal: 10,
  },
  bigOne: {
    width: 200,
    textAlign: "center",
    marginVertical: 15,
  },
});

export default HomeScreen;
